import React from 'react'
import Link from 'next/link'

const ErrorPage = () => {
  return (
    <div>
      <h1>Main Page</h1>
      <p>Go to <Link href="/auth">Auth</Link></p>
    </div>
  )
}

export default ErrorPage;
